        resources: [
          {
            user: {
                name: "Иван Иванович"
            } as IUser,
            orderItem: {
                id: 2,
                tActual: 1,
            } as IDataOrderItem


          } as IDataResourceOrder,
        ],
        etap : null,
        show: false
      }

     if(information.resources.length <= 0 )
     {
      setInformation(Example as any);
     }


